import React, { useState } from "react";

const Navbar = () => {
  // Variáveis de estado
  const [active, setActive] = useState("Home");
  const [toggle, setToggle] = useState(false);

  // Renderização da barra de navegação
  return (
    <nav className="w-full flex py-2 px-8 justify-between items-center navbar bg-trasnparent">
      // Seção do logotipo
      <img src="/logo (1) (1).png" alt="hoobank" className="w-[50px] h-[auto]" />

      // Seção do menu (oculto em telas menores)
      <ul className="list-none sm:flex hidden justify-end items-center flex-1">
        <li className="d-flex justify-between w-100">
          <a className="mr-6 cursor-pointer">Menu</a>
        </li>
      </ul>

      <div className="sm:hidden flex flex-1 justify-end items-center">
        <div
          className={`${!toggle ? "hidden" : "flex"}`}
          style={{
            p: 6,
            backgroundColor: "black",
            top: 20,
            right: 0,
            marginHorizontal: 4,
            marginVertical: 8,
            minWidth: 140,
            borderRadius: 100,
          }}
        >
          <ul className="list-none flex justify-end items-start flex-1 flex-col text-white">
            <li>
              <a>Home</a>
            </li>
            <li>
              <a>PHtech</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
